function createElement(e,t={},a=""){return`<${e} ${Object.entries(t).map((([e,t])=>`${e}="${t}"`)).join(" ")}>${a}</${e}>`}function generateList(e,t="",a=""){const n=e.map((e=>createElement("li",{class:a},e))).join("");return createElement("ul",{class:t},n)}function generateTable(e,t=""){const a=e.map((e=>createElement("tr",{},e.map((e=>createElement("td",{},e))).join("")))).join("");return createElement("table",{class:t},a)}function generateParagraph(e,t=""){return createElement("p",{class:t},e)}function generateNavbar(e,t="",a=""){const n=e.map((e=>createElement("a",{href:e.href,class:a},e.text))).join("");return createElement("nav",{class:t},n)}module.exports={createElement:createElement,generateList:generateList,generateTable:generateTable,generateParagraph:generateParagraph,generateNavbar:generateNavbar};